  false,\n\t\"url\": null,\n\t\"notes\": \"nTIGER, TIGER/Line, and Census TIGER are
  registered trademarks of the Bureaunof the Census. The Redistricting Census 2000
  TIGER/Line files are an extractnof selected geographic and cartographic information
  from the Census TIGERndata base.  The geographic coverage for a single TIGER/Line
  file is a countynor statistical equivalent entity, with the coverage area based
  on January 1,n2000 legal boundaries.  A complete set of Redistricting Census 2000
  TIGER/Linenfiles includes all counties and statistically equivalent entities in
  the UnitednStates and Puerto Rico.  The Redistricting Census 2000 TIGER/Line files
  willnnot include files for the Island Areas. The Census TIGER data base representsna
  seamless national file with no overlaps or gaps between parts.  However, eachncounty-based
  TIGER/Line file is designed to stand alone as an independent datanset or the files
  can be combined to cover the whole Nation.  The RedistrictingnCensus 2000 TIGER/Line
  files consist of line segments representing physicalnfeatures and governmental and
  statistical boundaries.  The Redistricting Censusn2000 TIGER/Line files do NOT contain
  the ZIP Code Tabulation Areas (ZCTAs) andnthe address ranges are of approximately
  the same vintage as those appearing innthe 1999 TIGER/Line files.  That is, the
  Census Bureau is producing thenRedistricting Census 2000 TIGER/Line files in advance
  of the computer processingnthat will ensure that the address ranges in the TIGER/Line
  files agree with thenfinal Master Address File (MAF) used for tabulating Census
  2000.  The files containninformation distributed over a series of record types for
  the spatial objects of ancounty.  There are 17 record types, including the basic
  data record, the shapencoordinate points, and geographic codes that can be used
  with appropriate softwarento prepare maps.  Other geographic information contained
  in the files includesnattributes such as feature identifiers/census feature class
  codes (CFCC) used tondifferentiate feature types, address ranges and ZIP Codes,
  codes for legal andnstatistical entities, latitude/longitude coordinates of linear
  and point features,nlandmark point features, area landmarks, key geographic features,
  and areanboundaries.  The Redistricting Census 2000 TIGER/Line data dictionary containsna
  complete list of all the fields in the 17 record types.n\",\n\t\"owner_org\": \"c64722ff-641a-4ddd-bbb8-4bd9fd2e7963\",\n\t\"extras\":
